Here is a simple JavaScript program that generates and prints out the ASCII character and hexadecimal codes from 0 to 7F:

```javascript
for (let i = 0; i <= 127; i++) {
    console.log(`${i} - ${String.fromCharCode(i)} - \\x${i.toString(16).toUpperCase()}`);
}
```

This program uses a for loop to iterate over the range of ASCII characters from 0 to 7F (inclusive). For each iteration, it prints out the decimal code, the corresponding character, and the hexadecimal representation of the character.
